import './App.css';
import Nav from './components/Nav';
import Form from './components/Form';
import Entry from './components/Entry';
import Small from './components/Small';

function App() {
  return (
    <div className="App">
       <Nav/>

       <Form/>

      <Entry num = "1:" small = "yes" name = "Presbo" email = 'presbo@columbia.edu'/>
      <Entry num = "2:" small = "no" name = "John Jay Mouse" email = 'mouse@columbia.edu'/>
      <Entry num = "3:" small = "no" name = "Water Bottle Man" email = 'flipper@columbia.com'/>


    </div>
  );
}

export default App;
